    <div>
      <div className='cart'>

      </div>
      <div className='header'>
        <h2>Home</h2>
        <Link className='homeShop' to='/shop'> <h2>Catalog</h2></Link>
      </div>
      <div className='info'>
        <img className='shelf' alt='' src={Shelf}></img>
